import { Component } from 'react';
import * as React from 'react';

class Card extends Component {
    render() {
        return (
            <React.Fragment>
                <section className= "card-container">
                    <header>
                        <h2>Jane Smith</h2>
                    </header>
                </section>
            </React.Fragment>
        )
    }
}

export default Card;
